import Login from './pages/Login';
import Signup from './pages/Signup';
import Main from './pages/Main';
import { Navigate, useLocation } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css'


import { Routes, Route } from 'react-router-dom';
import './App.css';
import Table from './pages/Table';
import UsersPage from './pages/tables/UsersPage';
import InfopanelAccessPage from './pages/tables/InfopanelAccessPage';
import ReportsPage from './pages/tables/ReportsPage';
import LoadingStorefrontsPage from './pages/tables/LoadingStorefrontsPage';
import AuditPage from './pages/tables/AuditPage';
import OrdersPage from './pages/tables/OrdersPage';
import BillingPage from './pages/tables/BillingPage';

function App() {
  return (

    <>
    <Routes>
      <Route path="/" exact element={<Login/>}></Route>
      <Route path="/signup" element={<Signup/>}></Route>
        <Route path="/main" element={<RequireAuth><Main/></RequireAuth>}>
          <Route path="users" element={<UsersPage/>}></Route>
          <Route path="infopanelaccess" element={<InfopanelAccessPage/>}>
            <Route path="organization" element={<Organ/>}></Route>
            <Route path="individuals" element={<Signup/>}></Route>
          </Route>
          <Route path="reports" element={<ReportsPage/>}></Route>
          <Route path="loadingstorefronts" element={<LoadingStorefrontsPage/>}></Route>
          <Route path="audit" element={<AuditPage/>}></Route>
          <Route path="orders" element={<OrdersPage/>}></Route>
          <Route path="billing" element={<BillingPage/>}></Route>
        </Route>
    </Routes>
    </>

  );
}

function RequireAuth({ children }) {
  let location = useLocation();
  if (false) {
    return <Navigate to="/" state={{ from: location }} replace />;
  }

  return children;
}

export default App;
